INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 1, "キャル", 0, 0, "2015/12/17 15:00:00", 1, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", "2030/12/17 14:59:59", 1, 7001, 7, 0.0, -363.0, 106001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 1, "コッコロ", 0, 0, "2015/12/17 15:00:00", 1, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", "2030/12/17 14:59:59", 1, 7002, 7, 0.0, -363.0, 105901);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 1, "ペコリーヌ", 0, 0, "2015/12/17 15:00:00", 1, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", "2030/12/17 14:59:59", 1, 7003, 7, 0.0, -363.0, 105801);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 1, "ペコリーヌ", 0, 0, "2015/12/17 15:00:00", 1, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", "2030/12/17 14:59:59", 1, 10001, 10, 0.0, -363.0, 105801);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 1, "キャル", 0, 0, "2015/12/17 15:00:00", 1, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", "2030/12/17 14:59:59", 1, 10002, 10, 0.0, -363.0, 106001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 1, "コッコロ", 0, 0, "2015/12/17 15:00:00", 1, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", "2030/12/17 14:59:59", 1, 10003, 10, 0.0, -363.0, 105901);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 1, "シェフィ", 0, 2104010, "2015/12/17 15:00:00", 1, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", "2030/12/17 14:59:59", 2, 10004, 10, 0.0, -363.0, 106401);
