INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 1, "キャル", 0, 0, "2015/12/17 15:00:00", 1, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", "2030/12/17 14:59:59", 1, 13001, 13, 0.0, -363.0, 106001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 1, "コッコロ", 0, 0, "2015/12/17 15:00:00", 1, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", "2030/12/17 14:59:59", 1, 13002, 13, 0.0, -363.0, 105901);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 1, "シェフィ", 0, 2104010, "2015/12/17 15:00:00", 1, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", "2030/12/17 14:59:59", 2, 13003, 13, 0.0, -363.0, 106401);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 1, "ペコリーヌ", 0, 0, "2015/12/17 15:00:00", 1, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", "2030/12/17 14:59:59", 1, 13004, 13, 0.0, -363.0, 105801);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 1, "コッコロ", 0, 0, "2015/12/17 15:00:00", 1, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", "2030/12/17 14:59:59", 1, 14001, 14, 0.0, -363.0, 105901);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 1, "シェフィ", 0, 2104010, "2015/12/17 15:00:00", 1, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", "2030/12/17 14:59:59", 2, 14002, 14, 0.0, -363.0, 106401);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 1, "ペコリーヌ", 0, 0, "2015/12/17 15:00:00", 1, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", "2030/12/17 14:59:59", 1, 14003, 14, 0.0, -363.0, 105801);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 1, "キャル", 0, 0, "2015/12/17 15:00:00", 1, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", "2030/12/17 14:59:59", 1, 14004, 14, 0.0, -363.0, 106001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 1, "コッコロ", 0, 0, "2015/12/17 15:00:00", 1, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", "2030/12/17 14:59:59", 1, 15001, 15, 0.0, -470.0, 105901);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 1, "シェフィ", 0, 2104010, "2015/12/17 15:00:00", 1, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", "2030/12/17 14:59:59", 2, 16001, 16, 0.0, -363.0, 106401);
