INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (4.08, 1, "エリコ（バレンタイン）", 10011, 0, "2019/01/31 12:00:00", 2, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", "2030/12/17 14:59:59", 1, 24001, 24, 8.0, -385.0, 109001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (5.0, 2, "エリコ（バレンタイン）", 10011, 0, "2019/01/31 12:00:00", 2, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", "2030/12/17 14:59:59", 1, 24002, 24, 8.0, -385.0, 109001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (10.11, 3, "エリコ（バレンタイン）", 10011, 0, "2019/01/31 12:00:00", 2, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", "2030/12/17 14:59:59", 1, 24003, 24, 8.0, -385.0, 109001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (4.0, 4, "エリコ（バレンタイン）", 10011, 0, "2019/01/31 12:00:00", 2, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", "2030/12/17 14:59:59", 1, 24004, 24, 8.0, -385.0, 109001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (6.0, 5, "エリコ（バレンタイン）", 10011, 0, "2019/01/31 12:00:00", 2, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", "2030/12/17 14:59:59", 1, 24005, 24, 8.0, -385.0, 109001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 6, "エリコ（バレンタイン）", 10011, 0, "2019/01/31 12:00:00", 1, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", "2030/12/17 14:59:59", 1, 24006, 24, 0.0, 0.0, 109002);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 7, "エリコ（バレンタイン）", 10011, 0, "2019/01/31 12:00:00", 1, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", "2030/12/17 14:59:59", 1, 24007, 24, 0.0, 0.0, 109002);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 8, "エリコ（バレンタイン）", 10011, 0, "2019/01/31 12:00:00", 1, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", "2030/12/17 14:59:59", 1, 24008, 24, 0.0, 0.0, 109002);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 9, "エリコ（バレンタイン）", 10011, 0, "2019/01/31 12:00:00", 1, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", "2030/12/17 14:59:59", 1, 24009, 24, 0.0, 0.0, 109002);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 10, "エリコ（バレンタイン）", 10011, 0, "2019/01/31 12:00:00", 1, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", "2030/12/17 14:59:59", 1, 24010, 24, 0.0, 0.0, 109002);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (2.12, 1, "シズル（バレンタイン）", 10011, 0, "2019/01/31 12:00:00", 2, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", "2030/12/17 14:59:59", 1, 24011, 24, 8.0, -385.0, 109101);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (4.19, 2, "シズル（バレンタイン）", 10011, 0, "2019/01/31 12:00:00", 2, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", "2030/12/17 14:59:59", 5, 24012, 24, 8.0, -385.0, 109101);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (2.3, 3, "シズル（バレンタイン）", 10011, 0, "2019/01/31 12:00:00", 4, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", "2030/12/17 14:59:59", 2, 24013, 24, 8.0, -385.0, 109101);
