INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (5.01, 7, "シズル（バレンタイン）", 10011, 0, "2019/01/31 12:00:00", 2, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", "2030/12/17 14:59:59", 1, 24017, 24, 8.0, -385.0, 109101);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 8, "シズル（バレンタイン）", 10011, 0, "2019/01/31 12:00:00", 1, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", "2030/12/17 14:59:59", 1, 24018, 24, 0.0, 0.0, 109102);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 9, "シズル（バレンタイン）", 10011, 0, "2019/01/31 12:00:00", 1, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", "2030/12/17 14:59:59", 1, 24019, 24, 0.0, 0.0, 109102);
