INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 1, "アメス", 0, 0, "2015/12/17 15:00:00", 1, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", "2030/12/17 14:59:59", 1, 46001, 46, 0.0, -371.5, 123001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 1, "シズル", 0, 0, "2015/12/17 15:00:00", 2, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", "2030/12/17 14:59:59", 2, 47001, 47, 0.0, -416.5, 104901);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (9.32, 1, "リノ", 0, 0, "2015/12/17 15:00:00", 2, "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", "2030/12/17 14:59:59", 1, 47002, 47, 0.0, -416.5, 101101);
